import React from 'react';

const Dashboard = ({photos, handlePhotoOnClick}) => {
  let noImagesDiv = <div className="no-photos"> Step up your photography game. Upload your first photo :) </div>;
  return (
    <div className="dashboard-wrapper">
      {photos.length ?
        photos.map((image, idx) =>
          <div key={idx} onClick={() => handlePhotoOnClick(image.id)} className={`imageContainer ${image.class}`}>
              <img className='photo' src={image.url} alt={idx}/>
          </div>):
        noImagesDiv }
    </div>
  )
}

export default Dashboard;
